# ## Background
# 
# We often use computers to complete complex mathematical tasks. One task of interest is computing the derivative of a function, that is finding **f’(x)** for a given function **f(x)**. It turns out that this task can be very difficult. However, we can use a technique called numerical differentiation to estimate the value of the derivate of a function at a given point. That is, instead of finding the general function **f’(x)**, we can approximate **f’(a)** where **a** is some real number.
# 
# There are three difference approximation techniques. They are forward, backwards, and centered differencing. Figure 1 depicts all 3 methods. The difference lies in whether you are adding or subtracting **h**, a very small number, or a combination of both. 
# 
# Let’s say you want to compute the derivative of your function f at the point x using forward differencing. The idea of this method is to compute the slope of a line from **f(x)** to **f(x+h)**, where h is a very small number (representing a small change in x). 
# 
# ![Figure 2](data:image/png;base64,)
# 
# The formulas for approximating the derivative at point x for each method are given in the table below.
# 
# | Method | Formula   |
# |------|------|
# |   **Forward Differencing**  | \begin{align}
#   f'(x) \approx \frac{f(x+h)-f(x)}{h} \tag{1}
# \end{align}|
# |   **Backwards Differencing**  | \begin{align}
#   f'(x) \approx \frac{f(x)-f(x-h)}{h} \tag{2}
# \end{align}|
# |   **Central Differencing**  | \begin{align}
#   f'(x) \approx \frac{f(x+h)-f(x-h)}{2h} \tag{3}
# \end{align}|
# 
# It is your job to develop a program for evaluating the derivative of a function at a given point using all three methods.
# 

