#DEFINE YOUR PART A FUNCTION BELOW:

#********************************************
# Write your eval_func function below: (6 marks)
#********************************************

def eval_func(x):
    f_x = x**2+3/x
    return f_x

eval_func(1.5)

#DEFINE YOUR PART B FUNCTIONS BELOW: 

#********************************************
# Write your forward_diff function below: (2 marks)
#********************************************

def forward_diff(x, h):
    fd = (eval_func(x+h) - eval_func(x))/h
    return fd

forward_diff(1.5, 0.01)

#********************************************
# Write your backwards_diff function below: (2 marks)
#********************************************

def backwards_diff(x, h):
    bd = (eval_func(x) - eval_func(x-h))/h
    return bd

backwards_diff(1.5, 0.01)

#********************************************
# Write your central_diff function below: (2 marks)
#********************************************

def central_diff(x, h):
    cd = (eval_func(x+h) - eval_func(x-h))/(2*h)
    return cd

central_diff(1.5, 0.01)


